import React from 'react';
import "./style.css";
import Card from '../UI/Card';

/**
* @author
* @function BlogPost

**/

const BlogPost
 = (props) => {
  return(
    <div>
    <Card width='70%'> 
        My First blog Post
    </Card>
    </div>
   )

 }

export default BlogPost;
